	add("multiculturalism", "{\"term\":\"multiculturalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|multi|cultural|ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The characteristics of a society, city etc. which has many different ethnic or national cultures mingling freely; political or social policies which support or encourage such coexistence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, Barbara Ehrenreich, \u0027Time\u0027, 8 Apr 1991\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something had to replace the threat of communism, and at last a workable substitute is at hand. \u0026quot;\u0027\u0027Multiculturalism\u0027\u0027,\u0026quot; as the new menace is known, has been denounced in the media recently as the new McCarthyism, the new fundamentalism, even the new totalitarianism -- take your choice\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, David Davis MP, \u0027Daily Telegraph\u0027, 3 Aug 2005\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Britain has pursued a policy of \u0027\u0027multiculturalism\u0027\u0027 - allowing people of different cultures to settle without expecting them to integrate into society\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0026quot;On a mat and a prayer\u0026quot;, \u0027The Economist\u0027, 7 Apr 2011\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Earlier this year he said \u0027\u0027multiculturalism\u0027\u0027 had “failed”, that immigrants needed to “melt” into French society, and that “we do not want ostentatious prayers in the street in France.”\", \"priority\":7}]}, \"synonyms\":{}}");

