	add("multiplication", "{\"term\":\"multiplication\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) from Old french (842-ca. 1400) \u0027multiplicacion\u0027 from Latin \u0027multiplicatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of computing the sum of a number with itself a specified number of times, or any other analogous binary operation that combines other mathematical objects.\u0026lt;!--When applied to whole numbers, multiplication can be considered as repeated addition. The multiplication \u0027x \u0026amp;times; y\u0027 is the same as \u0027x + x + ... + x\u0027, where the \u0027x\u0027 appears \u0027y\u0027 times in the addition, or \u0027y + y + ... + y\u0027, where the \u0027y\u0027 appears \u0027x\u0027 times in the addition.--\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A calculation involving multiplication\", \"priority\":2}]}, \"synonyms\":{}}");

	add("multiplier", "{\"term\":\"multiplier\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A number by which another (the multiplicand) is to be multiplied\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In the expression\u0027 5 × 7, \u0027the \u0026quot;5\u0026quot; is a \u0027\u0027multiplier\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The score \u0027\u0027multiplier\u0027\u0027 increases each time you complete a level of the video game\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An adjective indicating the number of times something is to be multiplied\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"English \u0027\u0027multipliers\u0027\u0027 include \u0026quot;double\u0026quot; and \u0026quot;triple\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A ratio used to estimate total economic effect for a variety of economic activities\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Any of several devices used to enhance a signa\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a coil; when w:Johann Johann Schweigger in 1820 invented the electric coil, increasing the electro-magnetic field from a single wire, this invention was called a \u0027multiplier\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A multiplier onion\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Marian Coonse, \u0027Onions, Leeks and Garlic: A Handbook for Gardeners\u0027 (page 52\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Shallots are the most prolific of all the \u0027\u0027multipliers\u0027\u0027, and easier to grow than onions\", \"priority\":11}]}, \"synonyms\":{}}");

