	add("multitude", "{\"term\":\"multitude\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|multitude}}, from Latin {{m|la|multitūdō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A great amount or number, often of people; myriad; profusion; abundance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Episode 12, \u0027The Cyclops\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A torrential rain poured down from the floodgates of the angry heavens upon the bared heads of the assembled \u0027\u0027multitude\u0027\u0027 which numbered at the lowest computation five hundred thousand persons\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The mass of ordinary people; the populous or the masse\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Pilate, wishing to please the \u0027\u0027multitude\u0027\u0027, released Barabbas to them\", \"priority\":5}]}, \"synonyms\":{}}");

